import React from 'react';
import style from './Post.module.css';
function Post(props) {
  return (
    <div className={style.main}>
      <div className={style.group_name}>
        <img className={style.image_group} src={props.imageGroup} alt="group image" />
        <div className={style.group_description}>
          <div>{props.groupName}</div>
          <div>{props.dataPost}</div>
        </div>
      </div>
      <div>
        <div className={style.post_description}>{props.description}</div>
        <img className={style.post_image} src={props.imagePost} alt="post image" />
      </div>
      <div className={style.group_like}>
        <div className={style.like}>Like {props.amountLike}</div>
        <div className={style.like}>Comments {props.amountPost}</div>
        <div>Reposts {props.amountReposts}</div>
      </div>
    </div>
  );
}

export default Post;
